import React from 'react';
import './styles.css';

// Main App Component
const LandingPage = () => {
  return (
    <div className="app">
      <Header />
      <MainContent />
      <Footer />
    </div>
  );
};

// Header Component
const Header = () => {
  return (
    <header className="header">
      <div className="header-content">
        <img className="logo" src="https://via.placeholder.com/150" alt="Brand Logo" />
        <nav>
          <ul className="nav-links">
            <li><a href="#about">About</a></li>
            <li><a href="#products">Products</a></li>
            <li><a href="#services">Services</a></li>
            <li><a href="#contact">Contact</a></li>
          </ul>
        </nav>
      </div>
    </header>
  );
};

// Main Content Section (Brand Information, Products, etc.)
const MainContent = () => {
  return (
    <div className="main-content">
      <section className="brand-info" id="about">
        <h2>About Us</h2>
        <p>We are a leading brand in the industry, known for quality and excellence.</p>
      </section>

      <section className="products" id="products">
        <h2>Our Products</h2>
        <div className="product-list">
          <div className="product">
            <img src="https://via.placeholder.com/200" alt="Product 1" />
            <p>Product 1</p>
          </div>
          <div className="product">
            <img src="https://via.placeholder.com/200" alt="Product 2" />
            <p>Product 2</p>
          </div>
          <div className="product">
            <img src="https://via.placeholder.com/200" alt="Product 3" />
            <p>Product 3</p>
          </div>
        </div>
      </section>

      <section className="services" id="services">
        <h2>Our Services</h2>
        <p>We provide a wide range of services including consultation, product customization, and more.</p>
      </section>

      <section className="brand-video" id="video">
        <h2>Watch Our Story</h2>
        <iframe
          title="Brand Story Video"
          width="100%"
          height="400"
          src="https://www.youtube.com/embed/dQw4w9WgXcQ"
          frameBorder="0"
          allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
          allowFullScreen
        ></iframe>
      </section>
    </div>
  );
};

// Footer Component
const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; 2024 Brand Name. All rights reserved.</p>
      <div className="social-links">
        <a href="https://www.facebook.com" target="_blank" rel="noopener noreferrer">Facebook</a>
        <a href="https://www.twitter.com" target="_blank" rel="noopener noreferrer">Twitter</a>
        <a href="https://www.instagram.com" target="_blank" rel="noopener noreferrer">Instagram</a>
      </div>
    </footer>
  );
};

export default LandingPage;
